const body = $json.body ?? $json ?? {};

return {
  email: body.Email || "",
  name: body.Name || "Attendee",
  rating: Number(body.Rating) || 0,
  feedback: body.Feedback || body.comment || "",
  attended: body.Attended !== false,
  webinarTitle: body['Webinar Title'] || "AI Automation Mastery Webinar",
  submittedAt: new Date().toISOString()
};

// ===============================
// Parse AI Agent Response (FINAL)
// ===============================

// 1Ô∏è‚É£ Extract AI text safely
const rawText =
  $json.output?.[0]?.content?.[0]?.text ||
  '{}';

// 2Ô∏è‚É£ Clean + parse JSON
let aiData = {};
try {
  const cleaned = rawText.replace(/```json|```/g, '').trim();
  aiData = JSON.parse(cleaned);
} catch (e) {
  aiData = {
    segment: "warm",
    thankYouMessage: "Thank you for attending the webinar.",
    nextSteps: []
  };
}

// 3Ô∏è‚É£ Promote parsed fields (DO NOT add resources here)
return {
  ...$json,
  aiSegment: aiData.segment || "warm",
  aiThankYouMessage: aiData.thankYouMessage || "Thank you for your feedback.",
  aiNextSteps: Array.isArray(aiData.nextSteps) ? aiData.nextSteps : []
};

// ===============================
// Build Professional Feedback Reply Email
// Mode: Run Once for Each Item
// ===============================

// Core data (DO NOT rename)
const name = $json.Name || 'there';
const email = $json.Email || '';
const webinarTitle = $json['Webinar Title'] || 'our webinar';

// -------------------------------
// Parse AI JSON SAFELY
// -------------------------------
let aiData = {};
try {
  aiData = JSON.parse($json.output[0].content[0].text);
} catch (e) {
  aiData = {};
}

const thankYouMessage =
  aiData.thankYouMessage || 'Thank you for sharing your feedback.';

const nextSteps = Array.isArray(aiData.nextSteps) ? aiData.nextSteps : [];

// -------------------------------
// Common Resources (already merged)
// -------------------------------
const resources = Array.isArray($json.resources) ? $json.resources : [];

// -------------------------------
// Optional sections
// -------------------------------
const nextStepsBlock = nextSteps.length
  ? `
    <div class="section">
      <h3>Suggested next steps</h3>
      <ul>
        ${nextSteps.map(step => `<li>${step}</li>`).join('')}
      </ul>
    </div>`
  : '';

const resourcesBlock = resources.length
  ? `
    <div class="section">
      <h3>Helpful resources</h3>
      <ul>
        ${resources
          .map(r => `<li><a href="${r.url}" target="_blank">${r.label}</a></li>`)
          .join('')}
      </ul>
    </div>`
  : '';

// -------------------------------
// Final HTML
// -------------------------------
const htmlContent = `
<!DOCTYPE html>
<html>
<head>
  <style>
    body {
      font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Arial, sans-serif;
      background-color: #f4f6f8;
      padding: 24px;
      color: #111827;
    }
    .container {
      max-width: 640px;
      margin: auto;
      background: #ffffff;
      border-radius: 8px;
      box-shadow: 0 6px 20px rgba(0,0,0,0.08);
    }
    .header {
      padding: 28px;
      border-bottom: 1px solid #e5e7eb;
    }
    .content {
      padding: 28px;
      font-size: 15px;
      line-height: 1.6;
    }
    h1 {
      font-size: 20px;
      margin: 0 0 12px 0;
    }
    h3 {
      font-size: 16px;
      margin-bottom: 8px;
    }
    .section {
      margin-top: 24px;
      padding-top: 16px;
      border-top: 1px solid #e5e7eb;
    }
    ul {
      padding-left: 18px;
      margin: 8px 0;
    }
    li {
      margin: 6px 0;
    }
    .footer {
      padding: 20px;
      font-size: 13px;
      color: #6b7280;
      border-top: 1px solid #e5e7eb;
    }
    a {
      color: #2563eb;
      text-decoration: none;
    }
  </style>
</head>
<body>
  <div class="container">
    <div class="header">
      <h1>Thank you, ${name}</h1>
      <p>Regarding ${webinarTitle}</p>
    </div>

    <div class="content">
      <p>${thankYouMessage}</p>

      ${resourcesBlock}
      ${nextStepsBlock}

      <p style="margin-top:24px;">
        If you have any questions or would like to discuss this further, feel free to reply to this email.
      </p>

      <p>
        Best regards,<br/>
        <strong>The Webinar Team</strong>
      </p>
    </div>

    <div class="footer">
      This email was sent in response to feedback you shared after attending our webinar.
    </div>
  </div>
</body>
</html>
`;

return {
  email,
  subject: `Thank you for your feedback ‚Äì ${webinarTitle}`,
  htmlContent
};

return [
  {
    json: {
      resources: [
        {
          label: "Webinar Recording",
          url: "https://yourdomain.com/webinar-recording"
        },
        {
          label: "Presentation Slides",
          url: "https://yourdomain.com/slides"
        },
        {
          label: "Automation Use-Case Library",
          url: "https://yourdomain.com/use-cases"
        }
      ]
    }
  }
];

// ===============================
// Generate Human-Readable feedback_id
// ===============================

const name = ( $json.body.Name|| 'Guest')
  .replace(/\s+/g, '')
  .trim();

const submittedAt = new Date(
  $json.submittedAt || Date.now()
);

// Format date parts
const date = submittedAt.toISOString().slice(0, 10); // YYYY-MM-DD
const time = submittedAt.toISOString().slice(11, 16); // HH:MM

const feedback_id = `${name}_${date}_${time}`;

return {
  ...$json,
  feedback_id
};
